import React, {Component} from 'react';
import "./css/index.scss"

class Reconmmend extends Component {
    render() {
        return (
            <div className="reconmmend">
                <img src={require("./img/recommend.png")} alt=""/>
            </div>
        );
    }
}

export default Reconmmend;
